import React from 'react';
import {connect} from 'react-redux'
import './view-lines.styles.scss'


const ViewLines = ({userTeam, opponentTeam}) => (
    <div className = 'view-lines'>
      <h1>View Lines</h1>  
      <div className = 'lineups'></div>
      <table >
      {Object.keys(userTeam).map((position, i) => (<tr><td>{userTeam[position].name}</td><td>{userTeam[position].projectedPoints}</td></tr>))}
      </table>
      <table >
      {Object.keys(opponentTeam).map((position, i) => (<tr><td>{opponentTeam[position].name}</td><td>{opponentTeam[position].projectedPoints}</td></tr>))}
      </table>
    </div>
)

const mapStateToProps = state => ({
  userTeam: state.lineup.userTeam,
  opponentTeam: state.lineup.opponentTeam
})
export default connect(mapStateToProps,null)(ViewLines)
